import { React } from 'react';
import Container from '@mui/material/Container';

function Home() {
  return (
    <div class>
      <React.Fragment>
      <CssBaseline />
      <Container maxWidth="sm">
        <Box sx={{ bgcolor: '#cfe8fc', height: '100vh' }} />
      </Container>
    </React.Fragment>
    </div>
  )
}
export default Home;
